import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import vuetify from './plugins/vuetify'; // Certifique-se de que o Vuetify está sendo importado corretamente

const app = createApp(App);

app.use(router);
app.use(vuetify);

app.mount('#app');
